package com.cloudcard.photoDownloader

import spock.lang.*

/**
 * This test actually calls out to the Workday API.
 * It is really an integration test, should only be turned on when integration with this api needs to be tested directly.
 */
@Ignore
class WorkdayClientSpec extends Specification {

    WorkdayClient client

    String base64Photo = "";
    String base64Photo2 = ""

    void setup() {
        Properties appProps = new Properties()
        // Can create application-test.properties from this secret:
        // https://836233235704-hfkd3jwd.us-east-2.console.aws.amazon.com/secretsmanager/secret?name=workday-test-credentials&region=us-east-2
        appProps.load(new FileInputStream("application-test.properties"))

        client = new WorkdayClient([
                apiUrl: appProps.getProperty("WorkdayClient.apiUrl"),
                tenantName: appProps.getProperty("WorkdayClient.tenantName"),
                username: appProps.getProperty("WorkdayClient.isu.username"),
                password: appProps.getProperty("WorkdayClient.isu.password"),
        ])

        client.init()
    }

    /**
     * basically this test verifies that these requests all work without throwing exceptions.
     * Not really a unit test, just a driver to allow manual invoking of the full client chain.
     */
    void "test all requests"() {
        expect:
        client.putWorkerPhoto("21001", base64Photo)
//        client.putWorkerPhoto("21001", base64Photo2)
    }

}

